import Name from "./NameName";

const Persons = (props) => {
    return (
        <ul>
            {props.persons.map((person) => (
                <Name
                    key={person.id}
                    name={person.name}
                    number={person.number}
                />
            ))}
        </ul>
    );
};

export default Persons;
